import logo from './logo.svg';
import './App.css';
import { userInfo } from 'os';
interface NameProps {
  value: string;
  onChange(event: any) : any;
}

interface NameState {
}

class NameInput extends React.Component<NameProps, NameState> {
  constructor(props: any) {
    super(props);
  }
  render() {
    return (<div>
      <input type="text" value= {this.props.value} onChange={this.props.onChange}/>
    </div>)
  }
}
interface AppProps {}
interface AppState {
  name: string
}
class App extends React.Component<AppProps, AppState> {
  constructor(props: any) {
    super(props);
    this.state = {
      name: ''
    }
    this.changeField = this.changeField.bind(this);
  }
  changeField(event: any) {
    this.setState({name: event.target.value})
  }
  render() {
    return(
      <div>
        <div>Name</div><NameInput value={this.state.name} onChange={this.changeField}/>
        <div>Name2</div><NameInput value={this.state.name} onChange={this.changeField}/>
      </div>
    )
  }
}


export default App;
